import React from "react";
import { Route, Switch, BrowserRouter, Link, withRouter } from "react-router-dom";
import "./App.css";
import Home from "./Home";
import About from "./About";
import Products from "./Products";
import { Nav, Navbar, Button } from "react-bootstrap";
import Logo from "./Assets/nklogo.png";

function Navigation(){
    return(
        <div>   
          <div id="nav">
        <BrowserRouter>

          <Navbar className="color-nav" variant="light">
         <Link to="/">
         <img style={{ width: "5rem", height: "3.5rem"}} src={Logo} ></img>
         </Link>
            <Nav>
              <Link to="products">
              <Button variant="light" style={{paddingLeft: "3rem"}}>Products</Button>
              </Link>
            </Nav>
            <div class="divider" />

            <Nav>
              <Link to="about">
                <Button variant="light">About</Button>
              </Link>
            </Nav>
          </Navbar>
        </BrowserRouter>
      </div>
        </div>
    )
}

export default Navigation;
